import requests
import random
import string
import time
import concurrent.futures

# Endpoint URL and headers
url = "https://stagingapi.finecore.co/v1/wallets"
headers = {
    "X-API-Key": "flk_6f1025328641a6b2b3b309cee58a27aa_1784140885",
    "Content-Type": "application/json"
}

# Function to generate a random BVN (Bank Verification Number)
def generate_bvn():
    return ''.join(random.choices(string.digits, k=11))

# Function to generate a random phone number
def generate_phone_number():
    return "080" + ''.join(random.choices(string.digits, k=8))

# Function to generate a random email
def generate_email():
    prefix = ''.join(random.choices(string.ascii_lowercase + string.digits, k=10))
    return f"{prefix}@mailexample.com"

# Function to send POST request and print response
def test_create_wallet():
    data = {
        "bvn": generate_bvn(),
        "first_name": "Jibril",
        "last_name": "Mohammed",
        "date_of_birth": "12-11-2003",
        "phone_number": generate_phone_number(),
        "email": generate_email(),
        "address": "No 10, Adewale Ajasin University"
    }
    response = requests.post(url, headers=headers, json=data)
    print(f"Status Code: {response.status_code}")
    print(f"Response Body: {response.json()}")

# Function to perform load test with concurrent requests
def load_test(concurrent_requests):
    with concurrent.futures.ThreadPoolExecutor(max_workers=concurrent_requests) as executor:
        futures = [executor.submit(test_create_wallet) for _ in range(concurrent_requests)]
        for future in concurrent.futures.as_completed(futures):
            try:
                future.result()
            except Exception as e:
                print(f"Request generated an exception: {e}")

# Parameters for load test
concurrent_requests = 100  # Number of concurrent requests

# Perform load test
start_time = time.time()
load_test(concurrent_requests)
end_time = time.time()

print(f"Load test completed in {end_time - start_time:.2f} seconds")


